import ExpenseItem from "./components/ExpenseItem";
function App() {
  const expense = [
    { title: "Television", amount: 220, date: new Date(2021, 10, 10) },
    { title: "Car insaurance", amount: 1000, date: new Date(2021, 9, 18) },
    { title: "Table", amount: 420, date: new Date(2021, 11, 11) },
    { title: "Computer System", amount: 870, date: new Date(2020, 10, 10) },
  ];
  return (
    <div>
      <ExpenseItem
        title={expense[0].title}
        amount={expense[0].amount}
        date={expense[0].date}
      ></ExpenseItem>
      <ExpenseItem
        title={expense[1].title}
        amount={expense[1].amount}
        date={expense[1].date}
      ></ExpenseItem>
      <ExpenseItem
        title={expense[2].title}
        amount={expense[2].amount}
        date={expense[2].date}
      ></ExpenseItem>
      <ExpenseItem
        title={expense[3].title}
        amount={expense[3].amount}
        date={expense[3].date}
      ></ExpenseItem>
    </div>
  );
}

export default App;
